import React, { Component } from 'react';

class DoneListItem extends Component {
    render() {
        return (
            <li>{this.props.Name}<button className="btn btn-default btn-xs pull-right"><span className="glyphicon glyphicon-remove" /></button></li>
        );
    }
}

const mapStateToProps = (state, ownProps) => {
    return {}
}

const mapDispatchToProps = (dispatch, ownProps) => {
    return {
        deleteData: (deleteId) => {
            dispatch({ type: "DELETE_DATA", deleteId: deleteId })
        }
    }
}

export default DoneListItem;
